DROP TABLE IF EXISTS `관광지`;
DROP TABLE IF EXISTS `테마`;

CREATE TABLE `테마`
(
    `테마분류`    CHAR(4) NOT NULL,
    `테마명`    VARCHAR(100),
 PRIMARY KEY ( `테마분류` )
);

CREATE TABLE `관광지`
(
    `관광지ID`    INTEGER NOT NULL,
    `코스ID`    INTEGER,
    `지역ID`    VARCHAR(10),
    `관광지명`    VARCHAR(100),
    `경도`    DECIMAL(11,7),
    `위도`    DECIMAL(11,8),
    `코스순서`    TINYINT,
    `이동시간`    TINYINT,
    `실내구분`    CHAR(6),
    `테마분류`    CHAR(4) NOT NULL,
 PRIMARY KEY ( `관광지ID` ),
 FOREIGN KEY ( `테마분류` ) REFERENCES `테마` (`테마분류`) ON UPDATE CASCADE
);

